import React from 'react';
// import { injectIntl } from 'react-intl';
// import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
// import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import ListSubheader from '@material-ui/core/ListSubheader';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import ListItemSecondaryAction from '@material-ui/core/ListItemSecondaryAction'
import TimerTwoToneIcon from '@material-ui/icons/TimerTwoTone';
import IconButton from '@material-ui/core/IconButton';
import DeleteForeverTwoToneIcon from '@material-ui/icons/DeleteForeverTwoTone';
import StarRateRoundedIcon from '@material-ui/icons/StarRateRounded';
import Chip from '@material-ui/core/Chip';
import WatchLaterRoundedIcon from '@material-ui/icons/WatchLaterRounded';
import { Typography } from '@material-ui/core';

import Graphy from '../components/graphic';

const styles = theme => ({
  bebe: {
    fontSize: 32,
  },
  root: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    minHeight: '100vh',
    backgroundColor: '#F7F7F7',
    textAlign: 'center',
    flexDirection: 'column',
  },
  paper: {
    margin: theme.spacing(4),
    padding: `${theme.spacing(3)}px ${theme.spacing(4)}px ${theme.spacing(4)}px`,
    width: '100%',
    maxWidth: theme.leftDrawerWidth,
  },
  contentLogo: {
    width: '100%',
    maxWidth: theme.leftDrawerWidth,
  },
  logo: {
    width: '100%',
    display: 'block',
    margin: `0 auto ${theme.spacing(1)}px`,
  },
});

function padNumber(value) {
  return value > 9 ? String(value) : "0" + value;
}

class History extends React.Component {
  constructor(props) {
    super(props);
    this.state = { time: 0, running: false };
    this.toggle = this.toggle.bind(this);
    this.tick = this.tick.bind(this);
  }
  toggle() {
    if (!this.state.running) {
      this.startTime = +new Date();
      this.tick();
    } else {
      this.update(false);
      clearTimeout(this.timeout);
    }
  }
  tick() {
    this.update(true);
    this.timeout = setTimeout(this.tick);
  }
  update(running) {
    this.setState({
      time: +new Date() - this.startTime,
      running
    });
  }
  render() {
    const { classes } = this.props;
    return (
      <div className={classes.root}>
        <Graphy />
        <div className="stopwatch">
          <Paper>
            <Button>Historial</Button>
            <List
              component="nav"
              aria-labelledby="nested-list-subheader"
              // className={classes.root}
              subheader={
                <ListSubheader component="div" id="nested-list-subheader">
                  Nested List Items
                </ListSubheader>
              }
            >
              <ListItem>
                <ListItemIcon>
                  <TimerTwoToneIcon/>
                </ListItemIcon>
                <ListItemText primary="00:00:02.31" />
                <ListItemSecondaryAction>
                  <IconButton edge="end" aria-label="delete">
                    <DeleteForeverTwoToneIcon />
                  </IconButton>
                </ListItemSecondaryAction>
              </ListItem>
              <ListItem>
                <ListItemIcon>
                  <TimerTwoToneIcon/>
                </ListItemIcon>
                <ListItemText primary="00:00:02.31" />
                <ListItemSecondaryAction>
                  <IconButton edge="end" aria-label="delete">
                    <DeleteForeverTwoToneIcon />
                  </IconButton>
                </ListItemSecondaryAction>
              </ListItem>
            </List>
          </Paper>
        </div>
      </div>
    );
  }
}

// History.propTypes = {

// };


export default withStyles(styles)(History);
